
import React from 'react'
import { Link } from 'react-router-dom'

const Speciality = () => {
  const doctorCategories = [
    {
      name: 'General physician',
      speciality: 'GeneralPhysician',
      image: 'data:image/jpeg;base64,'
    },
    {
      name: 'Gynecologist',
      speciality: 'Gynecologist',
      image: 'data:image/jpeg;base64,'
    },{
       name: 'Dermatologist',
        speciality: 'Dermatologist',
      image: 'data:image/jpeg;base64,'
    },{
       name: 'Pediatrician',
        speciality: 'Pediatrician',
      image: 'data:image/jpeg;base64,'
    },{
       name: 'Neurologist',
       speciality: 'Neurologist',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQHgCnFUqpZ25BkZKdyA39ctiVHbZSP57_FeA&s'
    },{
       name: 'Gastroenterologist',
      speciality: 'Gastroenterologist',
      image: 'data:image/jpeg;base64,'
    }
  ]
  return (
    <div id='speciality'>
      <div className='flex flex-col items-center space-y-10'>
        <h1 className='text-4xl font-bold'>Find by Speciality</h1>
        <p className='text-lg'>Simply browse through our extensive list of trusted doctors, schedule your appointment hassle-free.</p>
        <div className='flex flex-row items-center space-x-10'>
          {
            doctorCategories.map((category,index) => (
              <Link to={`/doctor/${category.speciality}`} key={index} className='flex flex-col items-center transform scale-100 transition-transform duration-300 hover:translate-y-[-15px]'>
                <img src={category.image} alt={category.name} className='rounded-full h-40 w-40' />
                <h3>{category.name}</h3>
              </Link>
            ))
          }
        </div>
      </div>
    </div>
  )
}

export default Speciality